INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.029, 0, 1, 1, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 122601, 1, 0, 110, 1, 1.5, 160, 105, 101);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.014, 1, 2, 0, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 122401, 3, 0, 105, 2, 2.5, 120, 111, 102);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.017, 0, 3, 0, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 122501, 2, 1, 110, 3, 2.5, 350, 105, 103);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.016, 1, 4, 0, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 107501, 3, 0, 110, 4, 1.5, 130, 105, 104);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.014, 0, 5, 1, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 107601, 1, 0, 110, 5, 2.5, 160, 105, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.029, 0, 6, 0, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 107801, 2, 1, 120, 6, 3.5, 255, 103, 106);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.013, 0, 7, 1, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 110601, 1, 0, 120, 7, 3.5, 160, 103, 107);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.014, 0, 8, 0, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 110401, 2, 1, 110, 8, 2.5, 350, 103, 108);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.012, 1, 9, 0, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 110501, 3, 0, 105, 9, 1.5, 130, 100, 109);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.014, 0, 10, 1, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 115701, 1, 0, 105, 10, 2.5, 200, 103, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.071, 0, 11, 0, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 113601, 2, 1, 105, 11, 2.5, 350, 103, 111);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.014, 1, 12, 0, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 107901, 3, 0, 120, 12, 1.5, 130, 103, 112);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.022, 0, 13, 1, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 108001, 2, 0, 110, 13, 1.5, 200, 105, 113);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.031, 0, 14, 1, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 110301, 1, 0, 110, 14, 2.5, 160, 108, 114);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.036, 1, 15, 0, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 107701, 1, 0, 110, 15, 0.5, 130, 105, 115);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.048, 0, 16, 0, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 113101, 2, 1, 110, 16, 3.5, 350, 95, 116);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.043, 1, 17, 0, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 113301, 3, 0, 105, 17, 1.5, 130, 105, 117);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.018, 1, 18, 0, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 113201, 2, 0, 105, 18, 1.5, 130, 95, 118);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.021, 0, 19, 1, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 117001, 2, 0, 110, 19, 2.5, 160, 108, 119);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.036, 0, 20, 0, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 113501, 1, 1, 110, 20, 2.5, 255, 105, 120);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.02, 0, 21, 0, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 113401, 3, 1, 105, 21, 2.5, 350, 105, 121);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.018, 1, 22, 0, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 110101, 1, 0, 110, 22, 2.5, 130, 105, 122);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.03, 0, 23, 1, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 110001, 3, 0, 105, 23, 3.5, 160, 111, 123);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.027, 1, 24, 0, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 117201, 1, 0, 110, 24, 1.5, 130, 103, 124);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.02, 0, 25, 1, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 117301, 2, 0, 105, 25, 3.5, 160, 108, 125);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.04, 0, 26, 0, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 117401, 3, 1, 110, 26, 2.5, 350, 105, 126);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.009, 0, 27, 0, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 117101, 1, 1, 110, 27, 3.5, 350, 105, 127);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.022, 0, 28, 0, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 122901, 1, 1, 120, 28, 3.5, 255, 105, 128);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.028, 1, 29, 0, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 122801, 3, 0, 110, 29, 2.5, 130, 105, 129);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (0.023, 0, 30, 1, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 122701, 2, 0, 105, 30, 3.5, 130, 108, 130);
